SELECT tbl_BasisDataset_RBB.RecordingGivid, Sum(tbl_BasisDataset_RBB.Percentage) AS hf_hfl_bedekking INTO t2
FROM tbl_BasisDataset_RBB INNER JOIN (SPECSYNO INNER JOIN t1 ON SPECSYNO.SPECIESNAM = t1.WetNaam) ON tbl_BasisDataset_RBB.SPECIESNAM = SPECSYNO.ORIGINALNA
GROUP BY tbl_BasisDataset_RBB.RecordingGivid;

